calculation:
For each sensor, offsets are calculated as (paramter + sensor_number * 4) to separate the 4 paramaters of sensor
    if (Slope 1 = Slope 2): knuckle = 0.0 (parallel)
    else: knuckle = (Intercept 2 - Intercept 1) / (Slope 1 - Slope 2)

    val = LVDT BU1 SW
    if (val < knuckle): LVDTKIPS = Slope 1 * val + Intercept 1
    else: LVDTKIPS = Slope 2 * val + Intercept 2

inputs:
Corner Relative Motion: {
    Riser B Relative Motion
    Riser D Relative Motion
    Riser I Relative Motion
    Riser M Relative Motion}
Draft

calculation:
StemOutVolume = (Stem Outer Length - (Freeboard - Stem Dist to Top)) * PI * (StemOutsideDiameter^2) - (RiserOutsideDiameter^2)) / 4.0
Stem Buoyancy = H2ODEN_LBSPERFT3 * (StemOutVolume - ((StemOuterLength - StemAirGap) * Stem ICSA)) / 1000.0
if (Freeboard > BC1 Dist to Top):
    BC1 Buoy = H2ODEN_LBSPERFT3 * ((BC1 Outer Length - Freeboard - BC1 Dist to Top)) * PI * ((BC1OutsideDiameter^2) - (StemOutsideDiameter^2)) / 4.0) / 1000.0
else:
    BC1 Buoy = H2ODEN_LBSPERFT3 * (BC1 Outer Length * PI * ((BC1OutsideDiameter^2) - (StemOutsideDiameter^2)) / 4.0) / 1000.0

EC Wind Speed with Factor = (1.11 * 1.0 / (1.0 + 0.137 * log(EC Wind Sensor Height /10METERSPERFT))) * EC Wind Speed
if (Archive Flag): EC Wind Speed with Factor
else: Running Average(EC Wind Speed with Factor)

WC Wind Speed with Factor = (1.11 * 1.0 / (1.0 + 0.137 * log(WC Wind Sensor Height /10METERSPERFT))) * WC Wind Speed
